import React, { useEffect, useState } from 'react';
import TabelaPedidos from '../../components/TabelaPedidos';
import Titulo from '../../components/Titulo';
import { CloseOutlined,SearchOutlined,ReloadOutlined} from '@ant-design/icons';
import {Container, Breadcrumb} from 'react-bootstrap';
import { Divider,Button, Modal, InputNumber} from 'antd';
import {showConfirm} from '../../components/ConfirmAcao';
import {notificarErro,notificarSucesso} from '../../components/Notificacao';
import {getKeyUsuarioLogado} from '../../../service/usuario';
import api from '../../../service/api';
import Form from 'antd/lib/form/Form';
const {Item} = Breadcrumb;

function Pedidos() {

    const [handlerUpdateTable,setHandlerUpdateTable] = useState(false);
    const [modalVisible, setModalVisible] = useState(false);
    const [loading, setLoading] = useState(false);
    const [data, setData] = useState('');

    useEffect(()=>{
    },[]);

    const buscarPedidos = async() => {
        const {data} = await api.get('/pedido',{params:{keyUsuario:getKeyUsuarioLogado()}});
        return data;

    }

    const acoes = {
        title: 'Ações',
        dataIndex: 'acoes',
        key: 'acoes',
        render: (_,record) => (
            <span>
                <Button
                    type='primary'
                    style={{ margin: '1px' }}
                    icon={<SearchOutlined />}
                    title='Ver Pedido'
                    onClick={_=>{visualizarPedido(record)}}
                />
                {record.status !== 'CANCELADO' &&
                <Button
                    type='primary'
                    style={{ margin: '1px' }}
                    danger
                    title='Cancelar Pedido'
                    icon={<CloseOutlined />} 
                    onClick={_=>{
                        showConfirm("Cancelar Pedido","Deseja Cancelar o pedido?",cancelarPedido,record.key);
                       }
                    }
                    />
                }
                {(record.status === 'CANCELADO' || record.status === 'FINALIZADO') && 
                    <Button
                    type='primary'
                    style={{ margin: '1px' }}
                    title='Repetir Pedido'
                    icon={ <ReloadOutlined />} 
                    onClick={_=>{repetirPedido(record)}}
                    />
                }
            </span>
        )
    };

    const visualizarPedido = pedido => {
        alert(pedido.id);
    }

    const cancelarPedido = async (key) => {
       try{
            await api.delete(`/pedido/${key}`,{params:{keyUsuario:getKeyUsuarioLogado()}});
            notificarSucesso('Pedido cancelado com sucesso!');
            setHandlerUpdateTable(!handlerUpdateTable);
       }catch(e){
           const {mensagem} = e.response.data;
           notificarErro(mensagem);
       }
    }

    const repetirPedido = (record) => {
        showConfirm("Repetir Pedido","Deseja repetir o pedido?",confirmRepetir,record.key);
    }

    const confirmRepetir = async (key) => {
        try{
            await api.post(`/pedido/${key}`,{params:{
                keyUsuario:getKeyUsuarioLogado()
            }})
            notificarSucesso('Pedido refeito com sucesso.')
        }catch(e){
            const {mensagem} = e.response.data;
            notificarErro(mensagem);
        }
    }

    const handleCancel = () => {
        setModalVisible(false);
        setLoading(false);
    }

    const layout = {
        labelCol: {
            span: 5,
        },
        wrapperCol: {
            span: 5,
        },
    };

    const tailLayout = {
        wrapperCol: {
            offset: 2,
            span: 5,
        },
    };

    return (
        <div>
            <Breadcrumb>
                <Item href="/">Principal</Item>
                <Item active>Pedidos</Item>
            </Breadcrumb>
            <Container>
                <Titulo name="Pedidos" />
                <Divider/>
                <TabelaPedidos getData={buscarPedidos} acoes={acoes} handlerUpdateTable={handlerUpdateTable}/>
                <Divider/>
                <Button type='primary' href='/perfilPedidos'>Cadastrar</Button>
                <Modal
                    title="Data do Pedido"
                    visible={modalVisible}
                    footer={[
                        <Button key="back" onClick={handleCancel}>
                          Cancelar
                        </Button>,
                        <Button key="submit" type="primary" loading={loading} onClick={repetirPedido}>
                          Ok
                        </Button>,
                      ]}

                    >
                    <Form {...layout}>
                        <Form.Item {...tailLayout}
                            label='Data: '
                        >
                        <InputNumber min={1} onChange={(value) =>{

                        }} value={data}/>
                        </Form.Item>
                    </Form>
                </Modal>
            </Container>
        </div>
    );
}

export default Pedidos;
